function 攻击时可斜向改变移动方向2(速度, 上下)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度 / 2);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度 / 2);
	}
	if (上下 > 0)
	{
		_parent.移动("上",速度);
	}
	else if (上下 < 0)
	{
		_parent.移动("下",速度);
	}
}

function 变招判定(招式名, 招式是否结束)
{
	if (_parent.操控编号 != -1 and _root.控制目标全自动 == false)
	{
		if (!_parent.飞行浮空 && _parent.动作B)
		{
			_parent.状态改变("兵器跳");
		}
		else if (_parent.动作A && 招式名)
		{
			if (_parent.左行)
			{
				_parent.右行 = 0;
				_parent.方向改变("左");
			}
			else if (_parent.右行)
			{
				_parent.左行 = 0;
				_parent.方向改变("右");
			}
			gotoAndPlay(招式名);
		}
		else if (_parent.左行 || _parent.右行 || _parent.上行 || _parent.下行)
		{
			_parent.动画完毕();
		}
	}
	else if (招式名 && !招式是否结束)
	{
		gotoAndPlay(招式名);
	}
}
function 刀口触发特效(状态名)
{
	if (_parent.特效刀口)
	{
		_parent.特效刀口.特效刀口触发(状态名);
	}
}
